/* MathDataValues - Any data value that is a part of a math-like data set. */

/**
 * Standard x/y point. A type is more effective than building a custom class for it.
 */
export type Point = {
  x:number;
  y:number;
};

/**
 * A simple width/height shape. A type is more effective than building a custom class for it.
 */
export type Size = {
  width:number;
  height:number;
};
